    data: |
      SELECT DISTINCT - col1 FROM tab1 (FORMAT parquet) WHERE ( col0 + + col1 ) NOT BETWEEN ( NULL ) AND + 53 + col0 * ( - col0 + + 32 );
  - name: tab1

outputs:
  - name: q7429.out
    data: |
      -14
      -47
      -5
